  true,\n\t\"url\": null,\n\t\"notes\": \"The detection and isolation of air vehicle
  process failures is difficultnbecause air vehicle dynamics are nonlinear and the
  vehicle has manynimportant and complicated sub-systems.  The fault diagnosis performancenis
  further complicated by the presence of sensor failures. In thisnproposal, Intelligent
  Automation, Incorporated (IAI) proposes a novelnapproach to perform simultaneous
  diagnosis of sensor and process faultsnfor air vehicles. This algorithm can be embedded
  into low costnelectronics. First, two independent residual vectors (RVs) for detectionnand
  isolation of the sensor and process faults are built. This is innsharp contrast
  to conventional methods, which can deal with eithernsensor failures or process failures
  but never both. Second, to isolatenfaults, the RV is transformed into a set of structured
  residual vectorsn(SRVs), where one SRV is made insensitive to a specified subset
  ofnfaults, while remaining sensitive to other faults. The proposedntechnology is
  relevant to this subtopic because we will develop annelectronic module that can
  be embedded in low cost sensor electronics tonquickly identify both sensor and process
  faults.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
